Renewing your driver's license or ID online is quick and easy! Let's get started!
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Driver's License or ID Card Renewal](https://www.dmv.ca.gov/portal/driver-licenses-identification-cards/renew-your-driver-license-dl-or-identification-card-id/)
* [Renewal Processing Times](https://www.dmv.ca.gov/portal/about-the-california-department-of-motor-vehicles/renewal-processing-times/)
{{/ifCond}}

You can replace a lost, stolen, or damaged driver's license online or at a DMV kiosk. ID card replacement requires an office visit. If you lost your card while outside of California, please call the Issuance Unit at 1-916-657-7790.
 {{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Online Replacement Driver's License Request](https://www.dmv.ca.gov/portal/driver-licenses-identification-cards/replace-your-driver-license-or-identification-dl-id-card/online-duplicate-driver-license-request/)
* [DMV Kiosks](https://www.dmv.ca.gov/portal/locations/kiosks/)
* [Appointment for Replacement ID Card](https://www.dmv.ca.gov/portal/appointments/select-appointment-type)
{{/ifCond}}

Select the link to search for a traffic school. You cannot register or attend traffic school on the DMV website. 
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Traffic School List](https://www.dmv.ca.gov/portal/vehicle-industry-services/occupational-licensing/occupational-license-lookup/traffic-school-list/)
{{/ifCond}}

The EPN program helps promote road safety by giving employers the ability to monitor the driving records of employees who drive for them.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Employee Pull Notice Program](https://www.dmv.ca.gov/portal/vehicle-industry-services/motor-carrier-services-mcs/employer-pull-notice-epn-program/)
* [EPN Online Requester](https://dmv.ca.gov/portal/vehicle-industry-services/motor-carrier-services-mcs/account-manager/)
{{/ifCond}}

DMV's vision is to be a trusted leader in delivering innovative services. This vision is supported by its mission to proudly serve the public by licensing drivers, registering vehicles, securing identities, and regulating the motor vehicle industry.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [About DMV](https://www.dmv.ca.gov/portal/about-the-california-department-of-motor-vehicles/)
{{/ifCond}}

Licensed dealers can submit online applications for New Reports of Sale for trailers and OHVs.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [New Trailer and Off-Highway Vehicle (OHV) Report of Sale](https://www.dmv.ca.gov/portal/dmv-virtual-office/new-report-of-sale/)
* [Virtual Field Office](https://www.dmv.ca.gov/portal/dmv-virtual-office/)
{{/ifCond}}

The Vehicle License Fee (VLF) is the portion of your registration that is tax deductible.  To calculate your VLF refer to the Vehicle License Fee calculator. Certain dealers licensed exclusively to sell used vehicles faced changes in the way they pay sales taxes beginning January 1, 2021. Refer to the Important Tax Information for Used Vehicle Dealers page for more information.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Vehicle License Fee Calculator]( https://www.dmv.ca.gov/wasapp/FeeCalculatorWeb/vlfForm.do)
* [Important Tax Information for Used Vehicle Dealers](https://www.dmv.ca.gov/portal/important-tax-information-for-used-vehicle-dealers/)
{{/ifCond}}

Please allow up to 90 days from the date the request was submitted for cash, check or ATM payments and 120 days for credit card payments. For vehicle registration refunds, please call (916) 657-6809. For driver’s license refunds, please call (916) 657-8545. To request a refund (if eligible), select the appropriate link.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Payments and Refunds](https://www.dmv.ca.gov/portal/customer-service/payments-refunds/)
* [Application for Refund (ADM 399) (PDF)](https://www.dmv.ca.gov/portal/file/application-for-refund-adm-399-pdf/)
{{/ifCond}}

If you drive a vehicle that meets certain emissions standards, you may be eligible for a Clean Air Vehicle (CAV) decal and identification card. These allow use of High Occupancy Vehicle (HOV, or carpool) lanes.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Clean Air Vehicle Decals for Using Carpool and HOV Lanes](https://www.dmv.ca.gov/portal/vehicle-registration/license-plates-decals-and-placards/clean-air-vehicle-decals-for-using-carpool-lanes/)
{{/ifCond}}

To add a firefighter endorsement to your driver's license, you must complete an application, pay the fee, and submit an original firefighter employment and training verification signed by the fire chief on fire department letterhead. You must also submit certification of employment as a firefighter, certification of completion of fire equipment operator training, and a Health Questionnaire {{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}DL546{{/ifCond}}{{#ifCond SessionAttributes.QNAClientFilter '===' 'ivr'}}D,L,546{{/ifCond}} form.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
[Firefighter Endorsement Training Requirements](https://www.dmv.ca.gov/portal/driver-education-and-safety/educational-materials/fast-facts/firefighter-endorsement-training-requirements-ffdl-42/)
{{/ifCond}}

Effective January 1st, 2020, a driver's license held by a U.S. Foreign Service member or their spouse, remains valid for the entire period the member or spouse remains out of state on active duty and 30 days after they return to the state, as long as the driver's license is not suspended, cancelled, or revoked.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
[Veterans and Active Duty Military](https://www.dmv.ca.gov/portal/driver-education-and-safety/special-interest-driver-guides/veterans-and-active-duty-military/)
{{/ifCond}}

DMV offers many online services that make starting and/or completing your DMV business fast, easy, and efficient, including paperless renewal notices. You can opt in to paperless renewal notices by logging in to your MyDMV account. Once you are opted in, you will receive driver’s license and registration renewal letters via email straight to your inbox instead of through physical mail.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Go Paperless](https://www.dmv.ca.gov/portal/paperless-notices/)
{{/ifCond}}

To check the status of your driver’s license, ID, or vehicle registration renewal, log in to your MyDMV account and view the status there, or select from the links below. If you requested a change of address online, check your MyDMV account after 3 business days. Your new address should be reflected there.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [MyDMV](https://www.dmv.ca.gov/portal/mydmv)
* [Driver’s License Renewal Status check](https://www.dmv.ca.gov/portal/driver-licenses-identification-cards/drivers-license-id-card-status/)
* [Vehicle Registration Renewal Status check](https://www.dmv.ca.gov/portal/vehicle-registration/vehicle-registration-status/)
{{/ifCond}}

Operating and moving permits may be issued in certain circumstances when all registration fees are paid, but license plates and/or registration stickers are not issued.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Temporary Operating Permits](https://www.dmv.ca.gov/portal/vehicle-registration/license-plates-decals-and-placards/temporary-operating-permits/)
{{/ifCond}}

Registered vehicle owners are required to insure their vehicles. If DMV doesn’t receive proof of insurance for a vehicle, it will suspend the vehicle’s registration, and until proof of insurance is submitted, the vehicle may not be operated or parked on public roadways.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Vehicle Registration Suspensions](https://www.dmv.ca.gov/portal/vehicle-registration/insurance-requirements/suspended-vehicle-registration/) 
* [$14 Suspended Registration Fee](https://www.dmv.ca.gov/wasapp/cisa/index.html) 
{{/ifCond}}

To apply for an ambulance driver certificate, you must be at least 18 years old, have a valid California driver's license, pay the application fee, submit a completed Medical Examination Report, submit a completed Request for Live Scan, and pass the ambulance certificate knowledge test.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
[Ambulance Certificates](https://www.dmv.ca.gov/portal/driver-education-and-safety/dmv-safety-guidelines-actions/driver-license-certificates-and-endorsements/)
{{/ifCond}}

To obtain a Power of Attorney (REG 260) form, select the link below.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Power of Attorney](https://www.dmv.ca.gov/portal/file/power-of-attorney-reg-260-pdf/)
{{/ifCond}}

Download the required bond document from DMV’s online library, complete it, and submit to DMV for processing. 
Bond must be signed by the surety and the signature must be notarized. A bond preprinted with the surety’s signature and notary acknowledgement is not acceptable.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}} 
* [How to Submit a Surety Bond](https://www.dmv.ca.gov/portal/vehicle-industry-services/occupational-licensing/login/) 
* [DMV Form Library (Bonds)](https://www.dmv.ca.gov/portal/forms/?q=bond#forms-filter-bar) 
{{/ifCond}}

Standard driver’s licenses are for individuals who are unable to provide proof of legal presence in the United States but who meet California DMV requirements and are able to provide proof of identity and California residency.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [AB 60 Driver’s License Guide](https://www.dmv.ca.gov/portal/driver-licenses-identification-cards/assembly-bill-ab-60-driver-licenses/)
{{/ifCond}}

Special interest/personalized license plates take months for review and production before being sent out. For current processing times select the link below.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Processing Times](https://www.dmv.ca.gov/portal/about-the-california-department-of-motor-vehicles/renewal-processing-times/)
* [Special Interest and Personalized License Plates Orders](https://www.dmv.ca.gov/portal/vehicle-registration/license-plates-decals-and-placards/california-license-plates/order-special-interest-and-personalized-license-plates/)
* [Order Personalized Plates by Mail](https://www.dmv.ca.gov/portal/dmv/detail/forms/reg/reg17)
{{/ifCond}}

Examples of Off Highway Vehicles are racing motorcycles, trail bikes, mini bikes, dune buggies, all terrain vehicles, jeeps, and snowmobiles. They are operated exclusively off public roads and highways on lands that are open and accessible to the public. They do not require regular registration, but must display an identification plate or sticker issued by California DMV and have valid off road registration.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Off-Highway Vehicle Registration](https://www.dmv.ca.gov/portal/vehicle-registration/new-registration/register-an-off-highway-vehicle-ohv/)
* [How To: Register an Off-Highway Vehicle](https://www.dmv.ca.gov/portal/how-to-register-an-off-highway-vehicle-ohv-htvr-19/)
* [Off-Highway Vehicle License Plates](https://www.dmv.ca.gov/portal/driver-education-and-safety/educational-materials/fast-facts/off-highway-vehicle-license-plates-ffvr-16/)
{{/ifCond}}

All trailers are registered under permanent trailer identification (PTI), except park, camp, fifth-wheel, and trailer coaches, which are registered annually. A permanent trailer identification service fee is charged for original registration and every five years for renewal. A registration card is issued with original registration to be kept with the trailer.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
[Registering Commercial Vehicles and PTI Trailers](https://www.dmv.ca.gov/portal/driver-education-and-safety/educational-materials/fast-facts/registering-commercial-vehicles-and-pti-trailers-ffvr-27/)
{{/ifCond}}

Governor Newsom issued an order authorizing fee waivers for Californians impacted by the firestorms in the Los Angeles area. To assist in expediting the recovery, we have streamlined many services. DMV is here to help you get back on the road to recovery.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
