For a REAL ID driver's license or identification card, federal regulations require 1 identity document and 2 residency documents, and your social security number.
Your identity document must be an original or certified copy. Residency documents must match both the name and address in your application. View the Easy as 1-2-3 REAL ID Document List or the REAL ID Checklist for more documents.
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Easy as 1-2-3 REAL ID Document List](https://www.dmv.ca.gov/portal/uploads/2020/06/dl1010E.pdf)
* [REAL ID Checklist](https://realid.dmv.ca.gov/your-real-id-checklist/)
{{/ifCond}}

You can complete the driver's license and or ID card application online or in a DMV office. If you complete the form online, you must create an account. The application is valid for 1 year. 
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Electronic Driver's License/ID Card Application](https://www.dmv.ca.gov/portal/driver-licenses-identification-cards/dl-id-online-app-edl-44/)
{{/ifCond}}

You must submit a Notice of Transfer and Release of Liability form within 5 calendar days from the date you sell or transfer your vehicle. Keep a copy for your records. 
Note: Submitting a Notice of Transfer and Release of Liability to DMV is not a transfer of ownership. The vehicle record is not transferred out of your name until DMV receives a completed application for transfer of ownership and payment of appropriate fees from the new owner.

{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Notice of Transfer and Release of Liability Online](https://www.dmv.ca.gov/portal/vehicle-registration/titles/title-transfers-and-changes/notice-of-transfer-and-release-of-liability-nrl/)
* [Notice of Transfer and Release of Liability by Mail](https://www.dmv.ca.gov/portal/dmv/detail/forms/reg/reg138)
{{/ifCond}}

If you move out of state with a California registered vehicle, let DMV know by changing your address at dmv.ca.gov/address-change. If you get a renewal notice but left California before registration expired, complete the back of the renewal notice or a Statement of Facts {{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}REG 256 {{/ifCond}} form with the date the vehicle left California, the date the vehicle was registered out of state, and the state's name where it is now registered. 
{{#ifCond SessionAttributes.QNAClientFilter '===' 'miles'}}
* [Moving Out of State](https://www.dmv.ca.gov/portal/driver-education-and-safety/special-interest-driver-guides/moving-out-of-state/)
{{/ifCond}}
